import React from "react";
import './App.css';
import Navbar from "./Components/Navbar";
// import Quizzpopup from "./Components/Quizzpopup";
import Header from "./Components/header";
import Challenges from './Components/main';
import loginForm from "./Components/login";


function App() {

  return (
      <>
      <div className="col col-lg-12 col-xl-12 col-sm-12">
        <Navbar />

        <Header />
      {/* <Quizzpopup/>  did not render on  the UI */}
      <Challenges />
      <loginForm />



      </div>
      </>

  );


}

export default App;
